import React from 'react';
import './App.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import Fade from 'react-reveal/Fade';


import Home from './components/Home';
import Landing from './components/Landing';
import Header from './components/Header';
import About from './components/About';
import Portfolio from './components/Portfolio';
import Contact from './components/Contact';
import Navbar from './components/Navbar'

function App() {
    return (
     <div className = "App" >
        <Router > {
            /* A <Switch> looks through its children <Route>s and
                  renders the first one that matches the current URL. */
        } 
        <Switch >
            <Route path ="/old" >
        <Old />
        </Route> 

        < Route path ="/" >
        <Landing />
        </Route> 

        <Route path="/homepage">
            <Homepage />
        </Route>

        </Switch> 
        </Router> 
        </div >
    );
}

function Homepage() {
      return( 
        <div>
        <br/><br/> <br/><br/> <br/><br/> <br/><br/> <br/><br/> <br/><br/>
    <h1 className='heading-background'>CREATIVE</h1>
        <Fade bottom>
        <h1 className='home'>
        <button className='home-button'><a href='home' rel="noopener noreferrer">production design</a></button>
        <button className='home-button'><a href='old' rel="noopener noreferrer">art assisting</a></button>
        <button className='home-button'><a href='home' rel="noopener noreferrer">render art</a></button>
            </h1>


        </Fade>



    </div>
      )
}

function Old() {
    return ( 
        <div className = "App" >
        <Navbar > </Navbar> 
        <div className = "App-header" >
        < Header > </Header> </div>
        <div className = 'About' >
        <About > </About> 
        </div> 
        < div className = 'portfolio' >
        <Portfolio > </Portfolio> 
        </div >
         <div className = 'contact' >
             < Contact > </Contact> 
         </div > 
         </div>
    )
}


export default App;
